import UIKit
func lengthOfLongestSubstring(_ s: String) -> Int {

    var longestSubstring = [Character]()
    var currentSubstring = [Character]()
    
    // scan each character
    for char in Array(s.characters) {
        // if not in currentDictionary
        if let idx = currentSubstring.index(of: char) {
//            print("idx= \(idx) \(currentSubstring)")
            if currentSubstring.count > longestSubstring.count {
                longestSubstring = currentSubstring
            }
            if idx < currentSubstring.count - 1 {
                currentSubstring = Array(currentSubstring.suffix(from: (idx+1)))
            } else {
                currentSubstring = [Character]()
            }
//                print("\(idx) \(currentSubstring.count) \(currentSubstring)")
        }
//        print ("adding \(char) to \(currentSubstring)")
        currentSubstring.append(char)
    }
    
    
    if currentSubstring.count > longestSubstring.count {
        longestSubstring = currentSubstring
    }
    
//    print("\(longestSubstring) \(longestSubstring.count)")
    return longestSubstring.count
    
}



